import React from 'react';

interface AvatarProps {
  imageUrl: string;
  altText: string;
}

const Avatar: React.FC<AvatarProps> = ({ imageUrl, altText }) => {
  return (
    <img
      className="avatar"
      src={imageUrl}
      alt={altText}
    />
  );
};

export default Avatar;
